;; **
;;; ### Image perturbations
;;; 
;; **

;; @@
(require 'htm-mnist.images :reload)

(table-view
(let [inval (last (train-inputs 3))
      img (imgs/bytes->image (:img-bytes inval) [28 28] 0)
      xspecs [(for [angle-z [-0.1 -0.05 0.05 0.1]]
                {:rotate (* angle-z Math/PI)})
              (for [dx [-2 0 2]
                    dy [-2 0 2]
                    :when (not= [dx dy] [0 0])]
                {:translate [dx dy]})
              (for [scale [0.75 0.9 1.15]]
                {:scale scale})
              (for [shear [[0.25 0] [-0.25 0] [0 0.25] [0 -0.25]]]
                {:shear shear})]
        ]
  (for [xspec-group xspecs]
    (cons
      (key (ffirst xspec-group))
      (for [xspec xspec-group
            :let [xform (imgs/affine xspec)]]
        (<img> (imgs/transform-image img xform) 84)))
    )
  ))

