;; **
;;; ### Threshold encoder
;; **

;; @@
(require 'htm-mnist.encoders :reload)

(def thresh-encoder
  (mnist-enc/threshold-encoder [28 28] {:threshold 128
                                        :decode-sparsity 0.25}))

(def idx-thresh-encoder
  (e/no-encoder [28 28]))

(defn reconstruct-image
  [e inbits-votes [w h]]
  (imgs/bytes->image (:value (first (p/decode e inbits-votes 1)))
                     [w h] 0))

(table-view
  [(for [inval (train-inputs 5)]
    [(<img> (imgs/bytes->image (:img-bytes inval) [28 28] 0) 84)
     (viz thresh-encoder (:img-bytes inval))
     (let [inbits (p/encode thresh-encoder (:img-bytes inval))]
       (<img> (reconstruct-image thresh-encoder (zipmap inbits (repeat 1)) [28 28])
              84))])])
