;; **
;;; ### Shade encoder
;; **

;; @@
(require 'htm-mnist.encoders :reload)

(def shade-encoder
  (mnist-enc/shade-encoder [28 28] {:thresholds [2 200 256]
                                    :decode-sparsity 0.15}))

(table-view
  [(for [inval (train-inputs 5)]
    [(<img> (imgs/bytes->image (:img-bytes inval) [28 28] 0) 84)
     (viz shade-encoder (:img-bytes inval) {:bit-w-px 3, :bit-h-px 3})
     ;; transparency for un-encoded parts
     (let [inbits (p/encode shade-encoder (:img-bytes inval))]
       (<img> (reconstruct-image shade-encoder (zipmap inbits (repeat 1)) [28 28])
              84 "#44ff44"))])])
