;; **
;;; ## Classification directly on input bits
;; **

;; @@
(require '[htm-mnist.classification :as clas] :reload)

(def classif-spec
  (->
    (clas/classification-layer-spec
      (zipmap (range 10) (range 10)))
    (util/deep-merge
      {:proximal {:perm-inc 0.08
                  :punish? false}})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/classif-spec</span>"}
;; <=

;; @@
(def inbits-classif-spec
  (util/deep-merge classif-spec
                   {:proximal {:perm-inc 0.02
                               }}))

(def clas-model
  (core/regions-in-series
    1 core/sensory-region
    [inbits-classif-spec]
    {:input [:img-bytes thresh-encoder]}))

(time
  (def clas-trained-1k
    (reduce clas/htm-step-with-label clas-model (train-inputs 1000))))

;; @@
;; ->
;;; Warning: unknown keys in spec: #{:classification}
;;; read 784016 bytes
;;; file has 60000 images at 28 x 28
;;; file has 60000 labels
;;; &quot;Elapsed time: 778.106727 msecs&quot;
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/clas-trained-1k</span>"}
;; <=

;; @@
(def clas-sh-model
  (core/regions-in-series
    1 core/sensory-region
    [inbits-classif-spec]
    {:input [:img-bytes shade-encoder]}))

(time
  (def clas-sh-trained-1k
    (reduce clas/htm-step-with-label clas-sh-model (train-inputs 1000))))
;; @@
;; ->
;;; Warning: unknown keys in spec: #{:classification}
;;; read 784016 bytes
;;; file has 60000 images at 28 x 28
;;; file has 60000 labels
;;; &quot;Elapsed time: 3335.06059 msecs&quot;
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/clas-sh-trained-1k</span>"}
;; <=

;; @@
(defn classif-connected-synapses-plot
  [htm]
  (let [clyr (-> htm (core/region-seq) (last) :layer-3)
      sg (:proximal-sg clyr)
      pcon (-> clyr :spec :proximal :perm-connected)
      cols (range (p/size-of clyr))
      conns
      (for [col cols]
        (->> (p/in-synapses sg [col 0 0])
             (filter (fn [[_ p]] (>= p pcon)))
             (count)))]
  (plot/bar-chart cols conns :plot-size 140)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/classif-connected-synapses-plot</span>"}
;; <=

;; @@
[(classif-connected-synapses-plot clas-trained-1k)
 (classif-connected-synapses-plot clas-sh-trained-1k)
 ]
