(defn class-score
  [votes true-class]
  (let [true-vote (or (votes true-class) 0)
        n-equal (count (filter #(== % true-vote) (vals votes)))
        ]
    (cond
      (zero? true-vote)
      0
      (< true-vote (apply max 0 (vals votes)))
      0
      :else
      (/ 1 n-equal))))

(defn classification-error-examples-table
  [model invals]
  (table-view
  (for [inval invals
        :let [this-htm (-> model
                         (p/htm-sense inval nil)
                         (p/htm-activate))
              clyr (-> (core/region-seq this-htm) (last) :layer-3)
              overlaps* (get-in clyr [:state :col-overlaps])
              overlaps (into (sorted-map) (map (fn [[[col _] o]] [col o])) overlaps*)
              true-col (:label inval)
              score (class-score overlaps true-col)
              img (imgs/bytes->image (:img-bytes inval) [28 28] gf-pad)]]
    [(<img> img 84)
     (:label inval)
     (when (seq overlaps)
       (plot/bar-chart (keys overlaps) (vals overlaps)
                       :plot-size 100))
     score
     ]
    )
    :columns '[input label estimates score]))
