(defn confusion
  [model invals]
  (->>
    (for [inval invals
        :let [this-htm (-> model
                         (p/htm-sense inval nil)
                         (p/htm-activate))
              clyr (-> (core/region-seq this-htm) (last) :layer-3)
              overlaps* (get-in clyr [:state :col-overlaps])
              max-o (apply max 0 (vals overlaps*))
              est-classes (keep (fn [[k v]] (when (== max-o v) k)) overlaps*)
              est-class (if (> (count est-classes) 1) (rand-nth est-classes) (first est-classes))
              est-col (first est-class)
              true-col (:label inval)
              ;score (class-score overlaps* [true-col 0])
              ]]
    [true-col est-col])
    (frequencies)))

(defn confusion-table
  [cfn]
  (table-view
    (let [classes (sort (distinct (map first (keys cfn))))
          by-true (group-by #(first (key %)) cfn)]
      (for [true-class classes
            :let [hits (->> (by-true true-class)
                            (map (fn [[[_ est-class] n]] [est-class n]))
                            (sort))
                  n-good (->> hits
                              (some (fn [[est-class n]] (when (= true-class est-class) n))))
                  n-total (->> hits
                              (map second)
                              (reduce +))]]
        [true-class
         (plot/bar-chart (map first hits) (map second hits) :plot-size 100)
         n-good
         n-total
         (round (* 100.0 (- 1.0 (/ (or n-good 0) n-total))))]))
    :columns '[class estimated correct N err%]))

(defn classification-error
  [cfn]
  (let [n-good (->> cfn
                    (keep (fn [[[true-class est-class] n]]
                             (when (= true-class est-class) n)))
                    (reduce +))
        n-total (->> cfn
                     (vals)
                     (reduce +))]
    (- 1.0 (/ (or n-good 0) n-total))))
