;; **
;;; ## Classification directly on inbits - with proximal punish process
;; **

;; @@
(require '[htm-mnist.classification :as clas] :reload)
(require '[org.nfrac.comportex.cells :as cells] :reload)

(def classifp-spec
  (->
    (clas/classification-layer-spec
      (zipmap (range 10) (range 10)))
    (util/deep-merge
      {:proximal {:perm-inc 0.08
                  :perm-dec 0.005
                  :perm-punish 0.005
                  :punish? true
                  :stimulus-threshold 2}})))

;; TODO next - try weighted excitations

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/classifp-spec</span>"}
;; <=

;; @@

(def clasp-model
  (core/regions-in-series
    1 core/sensory-region
    [classifp-spec]
    {:input [:img-bytes thresh-encoder]}))

(time
  (def clasp-trained-1k
    (reduce clas/htm-step-with-label clasp-model (train-inputs 1000))))

