;; **
;;; ### Reconstruction error
;; **

;; @@
(defn reconstruction-error-table
  [model invals viz-inbits]
  (table-view
  (for [inval invals
        :let [this-htm (-> model
                         (p/htm-sense inval nil)
                         (p/htm-activate))
              lyr (get-in this-htm [:regions :rgn-0 :layer-3])
              img (imgs/bytes->image (:img-bytes inval) [28 28] gf-pad)
              a-cols (p/active-columns lyr)
              col-inbits (zipmap a-cols
                               (map (fn [col]
                                      (->> (core/cells-proximal-bit-votes lyr [[col 0]])
                                           (keys)
                                           (set)))
                                    a-cols))]]
    [(<img> img 84)
     ;; show columns ordered by similarity (of receptive field bits) to last one, greedily
     (loop [this-rf (first col-inbits)
            more-rfs (dissoc col-inbits (key this-rf))
            out []]
       (if (seq more-rfs)
         ;; choose next column as the one with RF most similar to previous column
         (let [[col inbits] this-rf
               next-rf (apply max-key (fn [[test-col test-inbits]]
                                        (count (set/intersection test-inbits inbits)))
                              more-rfs)]
           (recur next-rf
                  (dissoc more-rfs (key next-rf))
                  (conj out [(viz-inbits inbits)
                             (count (set/intersection (val next-rf) inbits))]))
           )
         ;; finished - include this-rf
         (conj out (viz-inbits (val this-rf)))))
     ;; reconstruction from collective set of columns - weighted by number of synapses
     (let [orig-inbits (set (-> this-htm :senses :input p/bits-value))
           votes (core/cells-proximal-bit-votes lyr (for [col a-cols] [col 0]))
           re-inbits (->> votes
                          (filter (fn [[i v]] (>= v 1)))
                          (keys)
                          (sort-by votes >)
                          (take (count orig-inbits))
                          (set))
           ]
       [(viz-inbits orig-inbits)
        (viz-inbits re-inbits)
        :overlap
        (count (set/intersection re-inbits orig-inbits))
        :missing
        (count (set/difference orig-inbits re-inbits))
        :false+
        (count (set/difference re-inbits orig-inbits))
        ]
       )
     ]
    ))
)
