;; **
;;; ## HTM model - shaded, single layer, local
;; **

;; @@
(def shloc-spec
  loc-spec)

(def shloc-model
  (core/regions-in-series
   2 core/sensory-region
   [shloc-spec classif-spec]
    {:input [:img-bytes shade-encoder]}))
;; @@
