;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/shloc-model</span>"}
;; <=

;; @@
(time
  (def shloc-trained-1k
    (reduce clas/htm-step-with-label shloc-model (train-inputs 1000))))
