;; <=

;; **
;;; ## Supervised learning
;; **

;; @@

(def label-encoder (e/category-encoder [1000] (range 10)))

(def class-spec
  (util/deep-merge
    spec
    {:column-dimensions [10]
     :activation-level 0.10
     :proximal {:stimulus-threshold 1
                :perm-inc 0.03
                :perm-dec 0.01}
     :ff-init-frac 1.0
     :ff-perm-init-hi 0.25
     :ff-perm-init-lo 0.15}))

(def super-model
  (core/region-network
    {:v1 [:image]
     :class [:v1 :label]}
    {:v1 core/sensory-region
     :class core/sensory-region}
    {:v1 spec
     :class class-spec}
    {:image [:image image-encoder]
     :label [:label label-encoder]
     }
    nil))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;htm-mnist.work/super-model</span>"}
;; <=

;; @@
(time
  (def super-trained-30k
    (reduce p/htm-step super-model (train-inputs fg-indices 30000))))
